from typing import List
import queue

buffer: str = ''
def func():
    q: queue.Queue() = queue.Queue()
    for i in range(len(buffer)):
        if q.qsize() != 14:
            q.put(buffer[i])
            continue
        else:
            q.get()
            q.put(buffer[i])
            print(f'{set(q.queue)}')
        if len(set(q.queue)) == 14:
            return i+1

print(func())
